let ocr_plate;
let face;

const post_plate = async function () {
    const myHeaders = new Headers();
    myHeaders.append("Content-Type", 'application/json; charset="utf-8"');
    const raw = " ";
    const requestOptions = {
        method: 'POST',
        headers: myHeaders,
        body: raw,
        redirect: 'follow'
    };

    await fetch("https://api.openalpr.com/v3/recognize_bytes?recognize_vehicle=1&country=th&secret_key=sk_6db061527dc1e4d30b42cd2d", requestOptions)
        .then(response => response.json())
        .then(function (data) {
            const {results} = data;
            ocr_plate = results[0].plate;
        })
        .catch(error => console.log('error', error));
}

